const Navbar = (props) => {
  let HtmlNavbar = (
    <div className="h-screen flex flex-col justify-center items-center">
      <div className="h-10">
        <p className="text-4xl">Navbar</p>
      </div>
      <div className="border-red-500 border-2 w-full h-full">
        {props.component}
      </div>
    </div>
  );
  return HtmlNavbar;
};

export default Navbar;
